import './App.css';
import { Button, Alert } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import Header from './Header';
// import { useState } from 'react';
let List = [<h1>1</h1>, 2, 4, 5]
let count = 5
function App() {
  return (
    <>

      <div className="App">
      <Header />
        <header className="App-header">
          <Button as="a" variant="success">
            Enter
          </Button>
          {List}

          {count > 5 ? <Alert variant="success">sucess</Alert> : <Alert variant="danger">failure</Alert>}
        </header>
      </div>
    </>
  );
}

// function State() {
//   return (
//     let[Name, ChangeName] = useState("  Gnanlin")
//     < Button ></Button >
//   )
// }
// export { State }
export default App;
